import React, { useContext, useState } from "react";
import { TextField, Button } from "@material-ui/core";
import { DemoContainer, DemoItem } from '@mui/x-date-pickers/internals/demo';
import { DatePicker } from '@mui/x-date-pickers/DatePicker';
import { TimePicker } from '@mui/x-date-pickers/TimePicker';
import Calendario from "../Calendario/Calendario";
// import ValidacoesCadastro from "../../contexts/ValidacoesCadastro"
// import useErros from "../../models/hooks/useErros";

import Stack from 'stack';
import { Tooltip, styled } from '@material-ui/core';

const ProSpan = styled('span')({
  display: 'inline-block',
  height: '1em',
  width: '1em',
  verticalAlign: 'middle',
  marginLeft: '0.3em',
  marginBottom: '0.08em',
  backgroundSize: 'contain',
  backgroundRepeat: 'no-repeat',
  backgroundImage: 'url(https://mui.com/static/x/pro.svg)',
});


function Label({ componentName, valueType, isProOnly }) {
  const content = (
    <span>
      <strong>{componentName}</strong> for {valueType} editing
    </span>
  );

  if (isProOnly) {
    return (
      <Stack direction="row" spacing={0.5} component="span">
        <Tooltip title="Included on Pro package">
          <a href="https://mui.com/x/introduction/licensing/#pro-plan">
            <ProSpan />
          </a>
        </Tooltip>
        {content}
      </Stack>
    );
  }

  return content;
}

function Agenda({ aoEnviar }) {
  const [data, setData] = useState("");
  const [hora, setHora] = useState("");
  
  return (
    <form
    onSubmit={(event) => {
      event.preventDefault();
      // if (possoEnviar()) {
        aoEnviar({ data, hora });
      // }
    }}
    >
      <Calendario>
        <DemoContainer
          components={[
            'DatePicker',
            'TimePicker',
            'DateTimePicker',
            'DateRangePicker',
          ]}
        >
          <DemoItem
              value={data}
              onChange={(event) => {
                setData(event.target.value);
              }}
            label={
              <Label 
                componentName="Data do Agendamento" v
                alueType="date" 
              />
            }
          >
            <DatePicker />
          </DemoItem>
          <DemoItem 
            value={hora}
            onChange={(event) => {
              setHora(event.target.value);
            }}
            label={
              <Label 
                componentName="Horas do Agendamento" 
                valueType="time" 
              />
            }
          >
            <TimePicker />
          </DemoItem>
        </DemoContainer>
      </Calendario>
      <Button type="submit" variant="contained" color="primary" fullWidth>
        Finalizar Cadastro
      </Button>
    </form>
  );
}

export default Agenda;





